import { combinations } from "lodash";
interface SetPage{
    pc: number;
}

const SetPage = ({pc}: SetPage) => {
    document.title = `${pc}${["","st","nd","rd","th","th","th","th"][pc]} PC`;

    for(let piece1 of "TIJLOSZ"){
        for(let piece2 of "IJLOSZ"){
            if(piece2 == piece1)continue;
            for(let piece3 of "JLOSZ"){
                if(piece3 == piece1 || piece3 == piece2)continue;
                for(let piece4 of "LOSZ"){
                    if(piece4 == piece1 || piece4 == piece2 || piece4 == piece3)continue;
                    console.log(piece1,piece2,piece3,piece4);
                    
                }
            }
        }
    }
    

    return <div className="hi">hi</div>;
}

export default SetPage;
